import React, {Component, useState, useEffect} from 'react'

function RcvDT() {
  useEffect(() =>{
    fetchItems()
  }, [])

  const listaObj = 
  [
    {
    description: "kaio Nunes",
    LastBoa: "0",
    createdAt: "2019-07-22"
    },
    {
    description: "Chico Picole",
    LastBoa: "1",
    createdAt: "2019-07-22"
    }
  ]  
  const myObj = JSON.stringify(listaObj)

  console.log(myObj)

  const [items, setItems] = useState([])


  const fetchItems = async() => {
    const data = await fetch(this.myObj)


    const items = await data.json()
    console.log(items)
    setItems(items)
  }

  return (
    <div>
      {items.map(item => (
        <h1>item.description</h1>
      ))}
    </div>
  )    
}


export default RcvDT
